import { RasterTileType } from '@antv/l7-core';
import DebugTile from "./DebugTile";
import ImageTile from "./ImageTile";
import MaskLayer from "./MaskTile";
import RasterRGBTile from "./RasterRGBTile";
import RasterTerrainRGBTile from "./RasterTerrainRGBTile";
import RasterTile from "./RasterTile";
import VectorTile from "./VectorTile";
export function getTileFactory(layer) {
  var tileType = layer.type;
  switch (tileType) {
    case 'PolygonLayer':
      return VectorTile;
    case 'LineLayer':
      return VectorTile;
    case 'PointLayer':
      return VectorTile;
    case 'TileDebugLayer':
      return DebugTile;
    case 'MaskLayer':
      return MaskLayer;
    case 'RasterLayer':
      var dataType = layer.getSource().parser.dataType;
      switch (dataType) {
        case RasterTileType.RGB:
        case RasterTileType.CUSTOMRGB:
          return RasterRGBTile;
        case RasterTileType.ARRAYBUFFER:
        case RasterTileType.CUSTOMARRAYBUFFER:
          return RasterTile;
        case RasterTileType.TERRAINRGB:
        case RasterTileType.CUSTOMTERRAINRGB:
          return RasterTerrainRGBTile;
        default:
          return ImageTile;
      }
    default:
      return VectorTile;
  }
}
export * from "../interface";
export * from "./Tile";
